import Navigation from "../components/Navigation";
// import "../styles/pages/home.scss";
React.useEffect(() => {
  if (getMoviesUrl == "/movies") {
    setMoviesUrlBackgroundColor("red");
  } else {
    setMoviesUrlBackgroundColor("green");
  }
}, [getMoviesUrl]);
const Home = () => {
  return (
    <div class="container">
      <div className="main">
        <Navigation />
        <div class="step">
          <div>
            <p>Welcome to</p>
          </div>
          <div>
            <h1>E-smart rentals charlotte</h1>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
